import React from "react";
import '../index.css';


export default function Home () { 
    return (
        <div>
            <h1 className="home">Hi I'm Shatlyk br I am a passionate Full Stack Software Developer with a focus on creating innovative and user-friendly web and mobile applications. With expertise in JavaScript, React, Node.js, and React Native, I strive to deliver high-quality solutions that meet client needs and exceed expectations."</h1>
        </div>
    );
}
